// ProfilesPage.js

import React from 'react';

const ProfilesPage = () => {
  const renderProfileItems = () => {
    const profileItems = [];

    for (let i = 1; i <= 62; i++) {
      profileItems.push(
        <div key={i} className="portfolio-item">
          <a href="#">
            <img src={process.env.PUBLIC_URL + `default.jpeg`} alt="Default Image" />
            <span>Username {i}</span>
          </a>
        </div>
      );
    }

    return profileItems;
  };

  return (
    <div>
      <div className="container">
        <div className="portfolio-grid">{renderProfileItems()}</div>
      </div>
    </div>
  );
};

export default ProfilesPage;
